import React from 'react'
import { Route, Routes } from 'react-router-dom'
import { DeleteAdmin, EditAdmin } from '../admin/adminActions'
import { ShowClients } from './clientActions'

export default function Clients() {
  return (
    <Routes>
        <Route exact path="/" element={<ShowClients /* adminList={adminList} *//>} />
        <Route path="/edit/" element={<EditAdmin/>} />
        <Route path="/delete/" element={<DeleteAdmin/>} />


      </Routes>
  )
}
